import React, {Component} from 'react';
import './Model.css';

const Model = ({content, closeAction}) => { 
    return (
        <div className="Model" onClick={closeAction}>
        	<div className = "Icon">
        		<a className="Close" />
        	</div>
            <div className="Content">
                {content}
            </div>
        </div>
    );
}

export default Model;
